g2:c.PROCEDURE.g2:a.TEXT:
_integrity-coreq-startup (Object: class gfr-startup-object, InitialStartup: truth-value, Modules: class symbol-list, Client: class object)
 
  devstuffName: symbol = the symbol gdev-internals-workspaces; 
  Err: class error;

begin

  {--- No startup required for module restart }
{
  if not(InitialStartup) then return;
}
  {--- For devstuff development environment } 
  if the item named by devstuffName exists and _integrity-coreq-regression-tests is not a member of the item-list named by devstuffName then
    insert _integrity-coreq-regression-tests at the end of the item-list named by devstuffName;

end on error (Err)
  call gerr-dispatch (Err, this procedure, gfr-default-window);
end
